function manualSwap() public {
    require(msg.sender == feeWallet);
    address contractAddress = address(this);
    require(!lockedAddresses[contractAddress]);
    flags = (1 << 248) | flags;
    require(!lockedAddresses[contractAddress]);
    require((flags >> 200) & 0xFF == 0, "Decompiler artifact");
    bytes memory wethCallData = abi.encodeWithSignature("WETH()");
    (bool success, bytes memory wethData) = router.staticcall(wethCallData);
    require(success);
    require(wethData.length >= 32, "Insufficient WETH data");
    address wethAddress;
    assembly {
        wethAddress := mload(add(wethData, 32))
    }
    require(address(this) != address(0), "ERC20: approve to the zero address");
    require(router != address(0), "ERC20: approve to the zero address");
    uint256 currentAllowance = _allowances[address(this)][router];
    emit Approval(address(this), router, currentAllowance);
    bytes memory swapCall = abi.encodeWithSelector(
        0x791ac947,
        balanceOf[address(this)],
        0,
        new address[](2),
        address(this),
        block.timestamp
    );
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = wethAddress;
    assembly {
        mstore(add(swapCall, 100), path)
    }
    (success,) = router.call(swapCall);
    require(success);
    flags = uint248(flags);
    require(address(this).balance == 0, "Balance must be zero");
    (success,) = feeWallet.call{value: address(this).balance}("");
    require(success);
}

